ARTICULO UNICO. Concédense los siguientes suplementos a los ítems que se espresan de la partida 133 del presupuesto de Instruccion Pública:
Item 1, para pagar los suplentes de los empleados de Instruccion Pública, ocho mil pesos ($ 8,000);
Item 9, para jubilaciones, tres mil pesos ($ 3,000).
